.shouKuan {
  .link-decoration {
    text-decoration: underline;
  }
  .state{
    display: flex;
    justify-content: center;
    align-items: center;

    .circle.primary{
      background-color: #1890FF;
    }
    .circle.success{
      background-color: #52C41A;
    }
    .circle.error{
      background-color: #F5222D;
    }
    .circle.wran{
      background-color: #FA8C16;
    }
    .circle{
      border-radius: 50%;
      width: 5px;
      height: 5px;
      margin-right: 5px;
      background-color: rgba(145, 145, 145, 100);
    }
  }
  .action {
    width: 100%;
    display: flex;
    align-items: center;
    justify-content: space-between;
    margin-bottom: 22px;
    .excel-export{
      margin-left:10px;
      display: inline-block;
    }
    .checkbox-group {
      width: auto;
    }
  }
  .cout {
    color: #606266;
    font-size: 13px;
    border-radius: 2px;
    border: 1px solid #91d5ff;
    background-color: #e6f7ff;
    padding: 10px;
    .el-icon-warning {
      padding: 0 5px;
      color: #1890ff;
    }
  }
  .page {
    text-align: right;
    margin: 10px 0;
  }

  /deep/.table-header {
    background-color: #f7f7f7;
    font-weight: normal;
    color: #606266;
  }
}
